import React, { useReducer } from 'react'
import './styles.css'
import { todoReducer } from './todoReducer'


const initialState = [{
    id: new Date().getTime(),
    descripcion: "Aprender React",
    done: false
}]


export const TodoApp = () => {

    const [todos] = useReducer(todoReducer, initialState)

    console.log(todos);

    return (
        <div>
            <h1>TodoApp ({todos.length})</h1>
            <hr />


            <ul>
                <li>Hola</li>
                <li>Mundo</li>
                <li>Hola Mundo</li>
            </ul>
        </div>
    )

}
